    def popCard1(self):
        from temp import Ui_Form
        Dialog = QtWidgets.QDialog()
        ui = Ui_Form()
        ui.setupUi(Dialog)
        title = self.list1.currentItem().text()
        x = int(title[0])
        y = title[:2]
        if y == '10':
            x = 10
        ui.t1.setText(title[3:])
        world_url = " https://newsapi.org/v1/articles?source=bbc-news&sortBy=top&apiKey=f9a8d3004dfa46f09f135917bd658094"
        open_world_page = requests.get(world_url).json()
        article_wo = open_world_page["articles"]
        
        author_wo = []
        des_wo = []
        url_wo = []
        
        for i in article_wo:
            author_wo.append(i["author"])
            des_wo.append(i["description"])
            url_wo.append(i["url"])

        ui.l1.setText(author_wo[x - 1])
        ui.t2.setText(des_wo[x - 1])
        ui.t3.setText(url_wo[x - 1])
        Dialog.exec()

